    "description": "<p>Coming from years of manual social monitoring in marketing roles, Anya Law saw how expensive and ineffective traditional social listening was for startups. Meeting her co-founder at Atlanta Tech Village, she joined PitchGhost to transform a simple Twitter scraper into a full prompt-based, actionable social listening platform. The team discovered their ICP through trial and error—moving from solo founders to multi-person GTM teams who needed context-aware posts, sentiment filters, and response automation. With LinkedIn support as a major differentiator, PitchGhost is now expanding integrations, APIs, and CRM workflows to become a core part of the modern RevOps stack. Anya’s story is one of solving her own pain, refining personas, and building a tool that helps teams act—not just monitor. #SocialListening #GTMStrategy #MarketingAutomation</p>",
