    "episode": "1166",
    "title": "Ep1166: Matan Kadim: Ep1166 | Matan Kadim: Identity Drives Fitness",
    "guest": "Matan Kadim",
    "topic": "Ep1166 | Matan Kadim: Identity Drives Fitness",
    "description": "<p>Matan Kadim’s path into fitness began with a personal struggle and grew into a career of coaching and international learning. He argues that real change comes not from short-term resolutions but from identity-level shifts: who you see yourself as. Training, he explains, is not just against comfort zones but against evolutionary programming for ease and safety. By reframing workouts as daily battles with comfort, Matan helps clients develop resilience, discipline, and joy in the process. His “simple but not easy” philosophy cuts through misinformation and fad culture, emphasizing consistency, sleep, nutrition, and growth mindset. For Matan, the gym is a microcosm of life—identity, habits, and resilience all align to shape who you become.</p>",
