    "topic": "Ep1165 | Neta Bresler: Mind Art for Tech Teams",
    "description": "<p>Neta Bresler’s journey began with a childhood magic kit and evolved into a 1,500-student academy and global recognition as a top mentalist. Today, he reframes mentalism as “mind art”—a discipline that maps human blind spots and leverages them to teach, not just entertain. With stories like the “magic wand” blind spot and his red-to-purple team analogy, Neta explains how illusions translate into enterprise strategy. For him, certainty is the ultimate illusion, and breaking assumptions creates presence. He now works with tech companies on deception, perception, and product design, showing that the art of magic is really the science of human cognition.</p>",
