    "topic": "The Human Zero Day Series | Ep1161: Dr. Joshua Scarpino: Personalizing Security Culture",
    "description": "<p>From phishing tests to AI-driven impersonation scams, Joshua Scarpino has seen firsthand how the human element remains the most critical factor in cybersecurity. Drawing on his experience across organizations from NIST to Trust Engine, he explains why technology alone can’t safeguard an enterprise. Instead, effective defense comes from a culture where security is personal—linked to daily habits and values employees carry beyond the workplace. With threats evolving faster than traditional training can adapt, Scarpino shares how bite-sized, relevant, and personalized awareness programs not only reduce risk but transform how teams think, act, and protect.</p>",
