    "topic": "The Human Zero Day Series | Ep1160: Ira Winkler: Awareness Is Not a Strategy",
    "description": "<p>How do you protect an organization when every link in the chain can—and will—fail? Ira Winkler, NSA veteran and author of You Can Stop Stupid, unpacks why human error isn’t the root of security breaches—it’s the visible tip of deeper systemic gaps. From smashing the myth of awareness-as-strategy to advocating for consequence-driven behavior change, Ira brings sharp wit and decades of hands-on insight. His stories span black-bag hacks, social engineering triumphs, and boardroom-level shifts needed to reimagine how we address human vulnerabilities in a world of zero days.</p>",
