    "guest": "Daniel Flowe",
    "topic": "The Human Zero Day Series | Ep1159: Daniel Flowe: Building Trust in Digital Identity",
    "description": "<p>What happens when your “meatspace” identity can no longer keep up with your digital life? Daniel Flowe, Head of Digital Identity at the London Stock Exchange Group, takes us inside the tectonic shift reshaping how we verify who we are online. From the flaws of content-based systems to the promise—and risks—of government-issued e-IDs, he unpacks what equitable, secure, and scalable identity should look like in an AI-infused world. With insights drawn from India, Africa, and beyond, Daniel reveals why the West is lagging—and what we must do to catch up.</p>",
