    "topic": "The Human Zero Day Series | Ep1158: Beni Beeri Issembert: Who Am I in AI?",
    "description": "<p>Beni Beeri Issembert’s journey from aspiring philosopher to Head of AI Research and Ethics at Metaphysic is anything but linear. With a deep reverence for Nietzsche and an early curiosity about ethics in technology—long before it became a buzzword—Beni brings a rare perspective to synthetic media and AI. In this thought-provoking conversation, he explores how deepfakes challenge our sense of truth, what it means to have an identity in a world of synthetic realities, and why human discernment remains our most powerful tool. As AI continues to blur the lines between real and fake, Beni offers a hopeful yet grounded view on how we might navigate the future—with integrity, curiosity, and resilience.</p>",
