    "topic": "The Human Zero Day Series | Ep1156: Ilke Demir: Detecting Deepfakes by Heart",
    "description": "<p>Ilke Demir’s journey from computational geometry to combating deepfakes began with a question: what makes something truly human? At Intel’s Trusted Media team, she developed FakeCatcher, a tool that detects deepfakes using biological signals like heart rate. In this episode, she unpacks the technical, ethical, and social layers of media trust, explaining why provenance and human perception matter as much as detection. Her insights reveal how defending truth in the AI age isn’t just about better algorithms—it’s about understanding people.</p>",
