    "description": "<p>Fraud‑investigator‑turned‑entrepreneur Ori Eisen revives the 1990s “nobody knows you’re a dog” cartoon to show how today’s Gen‑AI deepfakes make that joke a board‑level risk. Tracing his path from inventing device‑fingerprinting to launching insured, passwordless logins, he argues identity—not credentials—is the internet’s final perimeter, urging enterprises to gauge every transaction by human‑level risk, from library cards to dam controls.</p>",
