    "description": "<p>Michael Nov’s journey—from the Israeli military to enterprise software and entrepreneurship—shaped his approach to product security. He shares how AI can bridge the gap between engineering and security teams, ensuring security is embedded at the design stage rather than becoming a last-minute hurdle. Drawing from his experience at OwnBackup and now as co-founder of Prime Security, he discusses the challenges of scaling security in fast-moving enterprises, the evolving role of AI in risk management, and why proactive security is key to business velocity.</p>",
