    "topic": "Ep1131: Get Off the X: Michele Rigby Assad on Moving Beyond Comfort Zones",
    "description": "<p>In the chaos of Baghdad during her CIA tour, Michelle Rigby Assad discovered that working harder wasn't enough—working on the right things was crucial. Drawing from intelligence vetting techniques, she explains how questioning established processes and being intentionally curious can transform both personal growth and organizational success. Her book \"Get Off the X\" explores moving beyond comfort zones toward purposeful action, emphasizing that meaningful progress often comes from small, consistent daily steps.</p>",
